;,[1738,logseq____&quot;^Flogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1738,logseq____&quot;^Xlogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1738,logseq____&quot;^Vlogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1738,logseq____&quot;^Ulogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1738,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6715c12f-ce17-4f8c-bc72-8f3dc1b8dedflogseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1739,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Aptly regarded as a man of many sounds by Billboard, Yottos Erased Dreams also marks Reflections debut LP release; an 8 track ambient journey, revealing a new side to one of Anjunas most illustrious producers. Well-known for his thunderous DJ sets and deep, bass-heavy house productions, Erased Dreams may seem like a departure from Yottos usual style, but hes always made music like this. With Reflections, he finally found a home for it.logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1739,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1739,logseq____&quot;^Flogseq____&quot;,1738,536870963]],[logseq____&quot;^15logseq____&quot;,[1739,logseq____&quot;^Xlogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1739,logseq____&quot;^Vlogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1739,logseq____&quot;^Ulogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1739,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6715c12f-16b1-4478-83ef-2bf37aecbff9logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1740,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Throughout his sparkling career, which includes a Billboard #1 LP and remixes of tracks by Joris Voorn, Gorillaz and Coldplay, Yotto has produced ambient music to help him look inward and re-charge his creative battery. But when COVID hit, his inner world took over. At first, I was being really productive with club music. But then after a while I started making something completely opposite. Yotto found himself exploring a different form of expression, with no plan other than to create. But when he put the tracks side-by-side in a playlist he recognised a synergy, and the outline of the project began to take shape. The result is more of a continuous soundscape than an album; an ethereal and dreamy experience designed toaccompany the listener as they turn inward and drift away. If club music is a form of escape, then this is too  but instead of turning outward, we lose ourselves inward.logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1740,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1740,logseq____&quot;^Flogseq____&quot;,1739,536870963]],[logseq____&quot;^15logseq____&quot;,[1740,logseq____&quot;^Xlogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1740,logseq____&quot;^Vlogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1740,logseq____&quot;^Ulogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1740,logseq____&quot;^Ulogseq____&quot;,1737,536870963]],[logseq____&quot;^15logseq____&quot;,[1740,logseq____&quot;^Hlogseq____&quot;,1737,536870963]],[logseq____&quot;^15logseq____&quot;,[1740,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6715c12f-287f-4925-a334-8ae0315059d2logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1741,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;The first single is Silhouette. Its a melancholy, atmospheric track with hints of 80s nostalgia and smooth as glass vocals from Sansa. The track conjures up images of vast and endless landscapes; the sense of space enhanced by sparse chord-changes and field recordings of heavy rain. Silhouette is so human it feels like an extension of an emotion, and Yotto says the idea came to him like a dream. A sound drifted towards him one day and he caught it by the tail and built on top of it until it became the entity he envisioned. Its slow and steady and it grows. I think the beauty lies in the simplicity of it.logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1741,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1741,logseq____&quot;^Flogseq____&quot;,1740,536870963]],[logseq____&quot;^15logseq____&quot;,[1741,logseq____&quot;^Xlogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1741,logseq____&quot;^Vlogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1741,logseq____&quot;^Ulogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1741,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6715c12f-121c-4634-a92d-4ec6202d6e7elogseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1742,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Club music will always be at the core of Yottos work, but his ambient catalogue will no longer sit in the shadows. Together, these parallel forms of expression dont dilute Yottos artistry; they make it even stronger.logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1742,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1742,logseq____&quot;^Flogseq____&quot;,1741,536870963]],[logseq____&quot;^15logseq____&quot;,[1742,logseq____&quot;^Xlogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1742,logseq____&quot;^Vlogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1742,logseq____&quot;^Ulogseq____&quot;,614,536870963]],[logseq____&quot;^15logseq____&quot;,[1742,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6715c12f-a2c7-4504-9405-37339487e89dlogseq____&quot;,53687096
